import React from "react";
import Aux from "../../hoc/Aux";
import "./Layout.css";
import Sidebar from "../Navigation/Sidebar/Sidebar";
const layout = (props) => {
  return (
    <Aux>
        <div className="toolbar">Toolbar</div>
        <Sidebar/>
        <main className="content">{props.children}</main>
    </Aux>
  );
};

export default layout;
